var myObj = "";
var request = new XMLHttpRequest();
request.open('GET','./json/mapInfo.json',false);
request.send();
if (request.status==200) {
    myObj = JSON.parse(request.responseText);
}

class App extends React.Component{
    constructor(props){
        super(props);
        this.state ={
            active: {
                title: myObj[1].title,
                sick: myObj[1].sick,
                healed: myObj[1].healed,
                died: myObj[1].died
            }
        }
    }

    changeActive = (title_new,sick_new,healed_new,died_new) =>{
        this.setState({
            active:{
                title: title_new,
                sick: sick_new,
                healed: healed_new,
                died: died_new
            }
        })
    }

    render(){
        return(
            <div className="app">
                <Main change={this.changeActive}/>
                <Options active={this.state.active}/>
            </div>
        )
    }
}

