function DrawRegion(props){
    let items = coord.map((element)=>{
        for (const key in myObj) {
            if (element[0] == myObj[key].code) {
                return(
                    <path key={element[0]} className="part" d={element[1]} fill='#078fda' onMouseEnter={()=>props.change(myObj[key].title,myObj[key].sick,myObj[key].healed,myObj[key].died)}></path>
                )
                break
            }
        }
    })
    return(
        <svg viewBox="0 0 1920 1080">
            {items}
        </svg>
    )
}

class Main extends React.Component{
    render(){
        return(
            <div className="map">
                
                    <DrawRegion change={this.props.change}/>
                    {/* <path className="part" d="" fill='#078fda' onMouseEnter={()=>this.props.change("",1,2,3)}></path>

                    <path className="part" d="" fill='#078fda' onMouseEnter={()=>this.props.change(" ",3,2,1)}></path> */}

                <img className="map__Russia" src="img/map.png"></img>
            </div>
        )
    }
}

class Options extends React.Component{
    render(){
        return(
            <div className="info">
                <h2 className="info__title">{this.props.active.title}</h2>
                <p className="info__sick">{this.props.active.sick} </p>
                <div className="info-row">
                    <div className="info-col">
                        <img className="info-ico" src="./img/death.svg" />
                        <p></p>
                        <p className='info-count'>{this.props.active.died}</p>
                    </div>
                    <div className="info-col">
                        <img className="info-ico" src="./img/patient.svg" />
                        <p></p>
                        <p className='info-count'>{this.props.active.healed}</p>
                    </div>
                </div>
            </div>
        )
    }
}

ReactDOM.render(<App/>, document.querySelector(`#app`))